import React from 'react';


//Main App Component
 class App extends React.Component {
  render() {
    return (
      <div className="app">
        <h2 className="app-title">Dog Breed Selector <span role="img" aria-label="dog">🐶</span></h2>
        <DoggoPicture image="/default-photo.jpeg" alt="dog eyes staring from screen"/>
        <DoggoBreed />
        <BreedList breedlist= {doggoArray} />
      </div>
    );
  }
}

//Image Component
//Start off with default props
//Picture of a pawprint
class DoggoPicture extends React.Component {
  render() {
    const image = this.props.image;
    const alt = this.props.alt;
    return (
      <img src={image} alt={alt} className="doggo-image" />
    );
  }
}

class DoggoBreed extends React.Component {
  render() {
    const name = this.props.breed;
    return (
      <div className="doggo-name">{name}</div>
    );
  }
}

class Breed extends React.Component {
  render() {
    return (
      "Hello."
    );
  }
}

//Breed List Component
class BreedList extends React.Component {
  render() {
    const rows = [];
    let breedlist = this.props.breedlist;

    breedlist.forEach((breed) => {
        rows.push(
          <Breed
          breed= {breedlist.breed}
          key= {breedlist.breed} />
        );
      });

    return (
      <ul className="dog-breed-list"></ul>
      );
    }
  }

